css:
atom-text-editor::shadow .editor-contents--private .highlight.hyperclick > .region {
  border-bottom: 1px solid #f8f8f2;
}
atom-text-editor.hyperclick::shadow .editor-contents--private {
  /**
   * Unfortunately, this cannot be a property of `.hyperclick .region`:
   * https://discuss.atom.io/t/some-css-styles-not-honored-by-decorations/11662
   */
  cursor: pointer;
}
atom-text-editor.hyperclick-loading::shadow .editor-contents--private {
  cursor: wait;
}
hyperclick-suggestion-list {
  cursor: default;
}
.hyperclick-suggestion-list-scroller {
  overflow-y: auto;
}
.hyperclick-result-item {
  cursor: pointer;
}
